webpackJsonp([20480867752385],{331:function(e,A){e.exports={data:{markdownRemark:{html:'<h1>Fullpower Firmware Internship</h1>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 105.84258812168035%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Fullpower"\n        title=""\n        src="/static/fp-overview-f07eae217a8b852e4330b0f7b1bc2d02-a408b.png"\n        srcset="/static/fp-overview-f07eae217a8b852e4330b0f7b1bc2d02-4eabf.png 148w,\n/static/fp-overview-f07eae217a8b852e4330b0f7b1bc2d02-5a375.png 295w,\n/static/fp-overview-f07eae217a8b852e4330b0f7b1bc2d02-a408b.png 590w,\n/static/fp-overview-f07eae217a8b852e4330b0f7b1bc2d02-9a0cc.png 885w,\n/static/fp-overview-f07eae217a8b852e4330b0f7b1bc2d02-aa987.png 1180w,\n/static/fp-overview-f07eae217a8b852e4330b0f7b1bc2d02-0c07a.png 1770w,\n/static/fp-overview-f07eae217a8b852e4330b0f7b1bc2d02-3a641.png 4142w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  </p>\n<p class=\'lb-project-caption\'>\nSource: Fullpower Technologies\n</p>\n<p>Over the summer of 2018, I worked as a firmware intern at <a href="https://www.fullpower.com/">Fullpower Technologies</a> in Santa Cruz, CA. I was tasked with improving the bootloader of the product depicted below, the Sleeptracker Monitor, which monitors the heart and breathing rate of a user while they sleep and makes the data available through a mobile app. The product runs embedded Linux and boots using <a href="https://www.denx.de/wiki/U-Boot">U-Boot</a>.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 51.6%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Fullpower"\n        title=""\n        src="/static/sleeptracker-0ce1b51e39e59cc7584f401ca8193ff3-ca545.jpg"\n        srcset="/static/sleeptracker-0ce1b51e39e59cc7584f401ca8193ff3-aa1b7.jpg 148w,\n/static/sleeptracker-0ce1b51e39e59cc7584f401ca8193ff3-b937a.jpg 295w,\n/static/sleeptracker-0ce1b51e39e59cc7584f401ca8193ff3-ca545.jpg 590w,\n/static/sleeptracker-0ce1b51e39e59cc7584f401ca8193ff3-75639.jpg 885w,\n/static/sleeptracker-0ce1b51e39e59cc7584f401ca8193ff3-a2b08.jpg 1000w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  </p>\n<p class=\'lb-project-caption\'>\nSource: Fullpower Technologies\n</p>\n<p>Prior to my internship, the Sleeptracker Monitor used an old version of U-Boot provided by the chip manufacturer that lacked flexibility and fault tolerance. Over the summer, I brought the product up to the most recent version of U-Boot and also implemented several features that decreased boot time and improved the product\'s failure recovery capability. My bootloader is now running on thousands of devices with no issue, and I\'ve only received one email asking for help! :)</p>\n<p>These are the primary features I implemented:</p>\n<ul>\n<li>Boot into a failsafe OS if main OS is not booting successfully.</li>\n<li>Allow reflashing both failsafe OS and main OS from the U-Boot command line using TFTP.</li>\n<li>Reduce reflash time by optimizing SPI flash driver.</li>\n</ul>\n<p>This project was incredibly rewarding, as it made a significant impact in the company. However, it did not come without its challenges. The MediaTek chipset (MT7688) was cheap and poorly documented, the source code for the old bootloader was hacked up and poorly written, and I did not have a practical debugging environment. Thus, there were many slow, painful days of debugging that produced little progress. However, by the end of the summer I had a working bootloader with all requested features that I was proud of.</p>',frontmatter:{title:"Fullpower"}}},pathContext:{slug:"/projects/fullpower/"}}}});
